import React from 'react';
import Car from './Car'

class Garage extends React.Component { 
    render() {
        const carName = "Lai Ngoc Bao's"
        const carInfo = {name: "Lai Ngoc Bao's", model: 'Votrol'}
        return (
            <div>
                <h1> Who lives in my Garage</h1>
                <Car color = "yellow" brand = {carInfo}/>
            </div>
        )
    }
}

export default Garage;
